import React, { Component } from "react";
import { Col, Panel } from 'react-bootstrap';
import HeaderBar from './../master/HeaderBar';
import './HomePage.css';
import Selfie from './../img/selfie.jpg';

class HomePage extends Component {
    render() {
        return (
            <div>
                <HeaderBar title="JM Miller Consulting" />
                <Panel className="page-contents-panel">
                    <hr style={{ background: "lightblue", width: "66%" }} />
                    <h4><span>Jonathan</span> <span>M</span> <span>Miller</span></h4>
                    <p>
                        <Col lg={4}>
                            <img style={{ width: "40%" }} src={Selfie}></img>
                        </Col>
                        <Col lg={7}>
                            <span>Lorem ipsum dolor sit amet consectetur adipisicing elit. Sint tempore ad repellendus dolor doloribus facilis eligendi, explicabo velit, provident natus, minima nam ipsa voluptate illum sit pariatur! Ut, animi quisquam.</span>
                        </Col>
                        </p>
                </Panel>
            </div>
        )
    }

}

export default HomePage;
